import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(employeeId,allowanceName,allowanceCode,category,date,startTime,endTime,Duration,premium,appliedDate,status) {
  return { employeeId,allowanceName,allowanceCode,category,date,startTime,endTime,Duration,premium,appliedDate,status };
}

const rows = [
  createData('mma0210','oncall','001','night','3/3/23','9:00 am','11:00 PM','14:00','-','12/4/23','appeoved')
];

export default function BasicTable() {
  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow >
            <TableCell>Employee ID</TableCell>
            <TableCell align="right">Allowance Name</TableCell>
            <TableCell align="right">Allowance Code</TableCell>
            <TableCell align="right">Category</TableCell>
            <TableCell align="right">Date</TableCell>
            <TableCell align="right">Start Time</TableCell>
            <TableCell align="right">End Time</TableCell>
            <TableCell align="right">Duration</TableCell>
            <TableCell align="right">Premium</TableCell>
            <TableCell align="right">Applied Date</TableCell>
            <TableCell align="right">Status</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow>
              <TableCell align="right">{row.employeeId}</TableCell>
              <TableCell align="right">{row.allowanceName}</TableCell>
              <TableCell align="right">{row.allowanceCode}</TableCell>
              <TableCell align="right">{row.category}</TableCell>
              <TableCell align="right">{row.date}</TableCell>
              <TableCell align="right">{row.category}</TableCell>
              <TableCell align="right">{row.category}</TableCell>
              <TableCell align="right">{row.category}</TableCell>
              <TableCell align="right">{row.category}</TableCell>
              <TableCell align="right">{row.category}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
